import axios from "axios";
class Youtube {
  constructor(key) {
    this.key = key;
    this.mostPopularConfig = {
      method: "get",
      url: `https://www.googleapis.com/youtube/v3/search?type=video&part=snippet&maxResults=25&q=${query}&key=${process.env.REACT_APP_YOUTUBE_API_KEY}`,
      headers: {},
    };
    this.searchConfig = {
      method: "get",
      url: `https://www.googleapis.com/youtube/v3/search?type=video&part=snippet&maxResults=25&q=${query}&key=${process.env.REACT_APP_YOUTUBE_API_KEY}`,
      headers: {},
    };
  }

  firstRender = async () => {
    const result = await axios(this.mostPopularConfig);
    return result.data.items;
  };
  search = async () => {
    const result = await axios(config);
    const data = result.data.items.map(item => ({
      ...item,
      id: item.id.videoId,
    }));
    return data;
  };
}
export default Youtube;
